import React from 'react';
import pricingPlanItems from './pricing-plan.json';
import styles from './Pricing.module.css';

const pricingItem = (props) => (
	<div className={styles.pricingContainer}>
		<div className="pricing-item">
			{' '}
			{pricingPlanItems.map((el) => {
				return (
					<div key={el.id}>
						<img className={styles.icon} src={el.icon} />
						<h2 className={styles.label}>{el.label}</h2>
						<p className={styles.capacity}>{el.capacity}</p>
						<p className={styles.description}>{el.description}</p>
						<p className={styles.price}>${el.price}/MO</p>
						<button className={styles.button}>Get Started</button>
					</div>
				);
			})}
		</div>
	</div>
);

console.log(pricingPlanItems);
console.log(pricingItem);

export default pricingItem;
